public class PowerOfThree {
    public boolean isPowerOfThree(int n) {
        if (n < 0 || n > Integer.MAX_VALUE / 3 + 1) {
            return false;
        }

        // Base case
        if (n == 3) {
            return true;
        }

        // Recursive case
        return isPowerOfThree(3 * n);
    }
