The following is a C++ program that reads a text file line by line and counts the number of occurrences of a specific word in the file. The program uses an iterator to read through the lines of the file and uses a counting variable to keep track of how many times the word appears in each line. The program then prints out the total number of occurrences of the word at the end of the program.

int main(int argc, char *argv[]) {
    ifstream file("input.txt");
    string word = "word";
    int counter = 0;
    for (string line; getline(file, line); ) {
        auto pos = line.find(word);
        if (pos != string::npos) {
            counter++;
        }
    }
    cout << "Word occurs " << counter << " time." << endl;
}
